import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from './serviceWorker';
import Form from './template/form/main';

serviceWorker.register();

const forminit = {
    id : '',
    class : '223',
    method : 'get',
    token : 'token',
    hash : 'hash',
    inputs : {
        name :{
            type:'text',
            value:'张宇',
            default:'请输入你的姓名',
        },
        sex :{
            type:'text',
            value:'男',
            default: '',
        },
        reg :{
            type:'text',
            value:'2018',
            default:'',
        },
        res :{
            type:'textarea',
            value:'2018',
            default:'',
        },
    }
};

ReactDOM.render(<Form forminit={forminit} />, document.getElementById('app'));

serviceWorker.unregister();
